def is_valid(s):
    return two_letters(s) and text_length(s) and zero_first_digit(s) and last_number_digit(s) and punctuation_check(s)

# check if the first letters are alpha
def two_letters(text):
    return text[:2].isalpha()

def text_length(text):
    return 2<= len(text) <=6

# check if there is a number in the plate and if it is zero
def zero_first_digit(text):
    for c in text:
        if c.isdigit():
            if int(c) == 0:
                return False
            else:
                return True

# check if the last digit is a number
def last_number_digit(text):
    return text[-1].isdigit()

# check if there is punctuation in text
def punctuation_check(text):
        for c in text:
            if c in "'.,;:?! ":
                return False
        else:
            return True

