function	script	F_WM_type	{
	switch(getarg(0,0)){
		case 3:  	case 6: 	case 7: 	case 8:	
		case 9:		case 12:	case 2:				return "Onslaught";	Break;
		case 1: 	case 16:	case 22:			return "Swiftness";	Break;
