//= 1.4d Added in menu selection instead of input [ vBrenth ]
//=      Adjusted to Hercules, added menu for Fav. [ Aeromesi]
//============================================================
-	script	OnInitSetup	-,{
OnInit:
$@MaxListW = 5;
end;
}
-	script	Warper	FAKE_NPC,{
function Go; function Disp; function Pick; function Restrict;

// --------------------------------------------------
//	Main Menu:
// --------------------------------------------------
MainMenu:
		mes @header$ = "[Warper]";
		mes "Where would you like to go?";
		next;
menu	"^8A2BE2Favorite Warps^000000",FavoriteWarps,
		"^00FFFFRecent Warps^000000",RecentWarps,
    	" ^800000~^000000 ^808000Towns^000000",Towns,
    	" ^800000~^000000 ^483D8BFields^000000",Fields,
    	" ^800000~^000000 ^696969Dungeons^000000",Dungeons,
    	" ^800000~^000000 ^FFD700Guild Castles^000000",Castles,
    	" ^800000~^000000 ^808000Guild Dungeons^000000",Guild_Dungeons,
    	" ^800000~^000000 ^006400Instances^000000",Instances,
    	" ^800000~^000000 ^8B4513Special Areas^000000",Special;
		FavoriteWarps:
		if ( recentwarp$[1] == "" ) {
		mes @header$;
		mes "You have never warped anywhere before.";
		next;
		callsub MainMenu;
}
		switch(select("[^800000Save^000000] - ^FF00FFRecent Warps^000000","[^800000Select^000000] - ^8A2BE2Favorite Warp^000000"))
		{
			case 1:
			// Save  Most Recent Warps
			favwarp$[1] = recentwarp$[1];
			favwarpx[1] = recentwarpx[1];
			favwarpy[1] = recentwarpy[1]; 

			favwarp$[2] = recentwarp$[2];
			favwarpx[2] = recentwarpx[2];
			favwarpy[2] = recentwarpy[2]; 

			favwarp$[3] = recentwarp$[3];
			favwarpx[3] = recentwarpx[3];
			favwarpy[3] = recentwarpy[3]; 

			favwarp$[4] = recentwarp$[4];
			favwarpx[4] = recentwarpx[4];
			favwarpy[4] = recentwarpy[4]; 

			favwarp$[5] = recentwarp$[5];
			favwarpx[5] = recentwarpx[5];
			favwarpy[5] = recentwarpy[5];
			mes @header$;
			mes "Saved.";
			next;
			callsub MainMenu;
			end;
			case 2:
	.@menu$ = "";
	for ( .n = 1; .n <= $@MaxListW; .n++ )
	{
		.@menu$ = .@menu$ + (.@n == 1 ? "":":") 
		+ (( favwarp$[.n])?""+.n+".) "
		+favwarp$[.n]+","
		+favwarpx[.n]+","+favwarpy[.n]
		+"":""+.n+".) ^FF00FFNo data yet^000000")+"";
	}
	.@choice = select(.@menu$) - 1;
	if ( favwarp$[.@choice] == "" )
	{
		next;
		callsub MainMenu;
	} else
		warp favwarp$[.@choice],favwarpx[.@choice],favwarpy[.@choice];
	end;
			
}
// --------------------------------------------------
// Recent Warps Option:
// --------------------------------------------------

	RecentWarps:
		mes @header$;
		if ( recentwarp$[1] == "" ) {
		mes "Not single warp done yet.";
		next;
		callsub MainMenu;
	}
	.@menu$ = "";
	for ( .n = 1; .n <= $@MaxListW; .n++ )
	{
		.@menu$ = .@menu$ + (.@n == 1 ? "":":") + (( recentwarp$[.n])?""+.n+".) "+recentwarp$[.n]+","+recentwarpx[.n]+","+recentwarpy[.n]+"":""+.n+".) ^FF00FFNo data yet^000000")+"";
	}
	.@choice = select(.@menu$) - 1;
	if ( recentwarp$[.@choice] == "" ) 
	{
		next;
		callsub MainMenu;
	} else
	warp recentwarp$[.@choice],recentwarpx[.@choice],recentwarpy[.@choice];
	end;

// ------------------- Functions -------------------
// * Go("<map>",<x>,<y>);
//	~ Warps directly to a map.
//
// * Disp("<Menu Option>",<first option>,<last option>);
// * Pick("<map_prefix>"{,<index offset>});
//	~ Dynamic menu and map selection (auto-numbered).
//
// * Disp("<Option 1>:<Option 2>:<etc.>");
// * Pick("","<map1>","<map2>","<etc.>");
//	~ Manual menu and map selection (listed).
//
// * Restrict("<RE | Pre-RE>"{,<menu option numbers>});
//	~ Only allows map for Renewal or Pre-Renewal modes.
//     If menu option numbers are given, only those maps
//     will be restricted (i.e. not for "Go").
//
// Other notes:
//   ~ Array @c[] holds all (x,y) coordinates.
//   ~ Use @c[2] EXCEPT when maps begin dynamically
//	  at 0: use @c[0] and Pick() offset 1.
// --------------------------------------------------

function Go {
if ( Listing == $@MaxListW ) {

	recentwarp$[1] = recentwarp$[2];
	recentwarpx[1] = recentwarpx[2];
	recentwarpy[1] = recentwarpy[2]; 

	recentwarp$[2] = recentwarp$[3];
	recentwarpx[2] = recentwarpx[3];
	recentwarpy[2] = recentwarpy[3];

	recentwarp$[3] = recentwarp$[4];
	recentwarpx[3] = recentwarpx[4];
	recentwarpy[3] = recentwarpy[4];

	recentwarp$[4] = lastwarp$;
	recentwarpx[4] = lastwarpx;
	recentwarpy[4] = lastwarpy;
	Listing--;
}

	lastwarp$ = getarg(0);
	lastwarpx = getarg(1,0);
	lastwarpy = getarg(2,0);
	Listing++;
	recentwarp$[Listing] = lastwarp$;
	recentwarpx[Listing] = lastwarpx;
	recentwarpy[Listing] = lastwarpy;
	warp getarg(0),getarg(1,0),getarg(2,0);
	end;
}
function Disp {
	if (getargcount() < 3)
		@menu$ = getarg(0);
	else {
		@menu$ = "";
		for (.@i = getarg(1); .@i <= getarg(2); .@i++)
			@menu$ = @menu$+getarg(0)+" "+.@i+":";
	}
	return;
}
function Pick {
	.@warp_block = @warp_block;
	@warp_block = 0;
	.@select = select(@menu$);
	if (getarg(0) == "") {
		.@i = .@select;
		.@map$ = getarg(.@i);
	} else {
		.@i = .@select-getarg(1,0);
		.@map$ = getarg(0)+((.@i<10)?"0":"")+.@i;
	}
	if (.@warp_block & (1<<.@select)) {
		dispbottom strcharinfo(PC_NAME),"This map is not enabled in "+(RENEWAL?"":"Pre-")+"Renewal.";
		end;
	}
	.@x = @c[.@i*2];
	.@y = @c[.@i*2+1];
	deletearray @c[0],getarraysize(@c);
	Go(.@map$,.@x,.@y);
}
function Restrict {
	if ((getarg(0) == "RE" && !RENEWAL) || (getarg(0) == "Pre-RE" && RENEWAL)) {
		if (getarg(1,0)) {
			@warp_block = 0;
			for (.@i = 1; .@i < getargcount(); .@i++)
				@warp_block = @warp_block | (1<<getarg(.@i));
		} else {
			dispbottom strcharinfo(PC_NAME),"This map is not enabled in "+(RENEWAL?"":"Pre-")+"Renewal.";
			end;
		}
	}
	return;
}

